import React from "react";
import { Link } from "react-router-dom";
import "./Home.css";

const Home = () => {
  const rotas = [
    { id: 1, nome: "Rota 1", descricao: "Uma rota incrível." },
    { id: 2, nome: "Rota 2", descricao: "Uma aventura inesquecível." },
  ];

  return (
    <div className="home">
      <h1>Bem-vindo ao RotaViagem</h1>
      <div className="rota-list">
        {rotas.map((rota) => (
          <div className="rota-card" key={rota.id}>
            <h2>{rota.nome}</h2>
            <p>{rota.descricao}</p>
            <Link to={`/rota/${rota.id}`}>Detalhes</Link>
          </div>
        ))}
      </div>
    </div>
  );
};

export default Home;
